import React from 'react';
import { Doughnut } from 'react-chartjs-2';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import {
  Card,
  CardHeader,
  CardContent,
  IconButton,
  Divider,
  Typography
} from '@material-ui/core';
import RefreshIcon from '@material-ui/icons/Refresh';
import { Grid } from "@material-ui/core";
import { connect } from 'react-redux';
import productStore from 'store/modules/productStore';
import { changeCurrentKeyword, changeCurrentProduct, changeCategory } from 'store/modules/productStore';
const useStyles = makeStyles(theme => ({
  root: {
    height: '100%'
  },
  chartContainer: {
    position: 'relative',
    height: '300px'
  },
  stats: {
    marginTop: theme.spacing(2),
    display: 'flex',
    justifyContent: 'center'
  },
  device: {
    textAlign: 'center',
    padding: theme.spacing(1)
  },
  deviceIcon: {
    color: theme.palette.icon
  }
}));

const PieChart = props => {
  const { className, ...rest } = props;
  const classes = useStyles();
  const theme = useTheme();


  //console.log("labeldata    -> " + props.graphData.labels);
  // console.log("graphData    -> " + JSON.stringify(props.graphData));
  // console.log("currentProduct    -> " + props.CurrentProduct);

  let titleString = props.CurrentProduct + "'s Keyword";

  const data = {
    datasets: [
      {
        data: props.reviewNumber,
        backgroundColor: ['#D31010', '#EB650B', '#EEDB0A', '#ABEB09', '#11E698'],
        borderWidth: 8,
        borderColor: theme.palette.white,
        hoverBorderColor: theme.palette.white
      }
    ],
    labels: ['Desktop', 'Tablet', 'Mobile']
  };

  const options = {
    legend: {
      display: true
    },
    responsive: true,
    maintainAspectRatio: false,
    animation: false,
    cutoutPercentage: 80,
    layout: { padding: 0 },

    tooltips: {
      enabled: true,
      mode: 'index',
      intersect: false,
      borderWidth: 1,
      borderColor: theme.palette.divider,
      backgroundColor: theme.palette.white,
      titleFontColor: theme.palette.text.primary,
      bodyFontColor: theme.palette.text.secondary,
      footerFontColor: theme.palette.text.secondary
    },

  };
  const { changeCurrentKeyword } = props;
  //const data = props.graphData;
  const keywords = props.graphData.labels;

  const keywordClick = (keyword) => {
    changeCurrentKeyword(keyword);
    console.log("changeCurrentKeyword", props.CurrentKeyword);
  }

  return (
    <Card
      {...rest}
      className={clsx(classes.root, className)}
    >
      <CardHeader
        action={
          <IconButton size="small">
            <RefreshIcon />
          </IconButton>
        }
        title={titleString}
      />
      <Divider />
      <CardContent>
        <div className={classes.chartContainer}>
          <Doughnut
            data={data}
            options={options}

          />
        </div>
        <div><p>Click Keyword </p></div>
        <div className={classes.stats}>
          <Grid container spacing={1}>
            {keywords.map(keyword => (
              <Grid item xs={12} sm={3}>
                <Button variant="outlined" fullWidth='true' color="primary" onClick={() => keywordClick(keyword)} >{keyword}</Button>
              </Grid>

            ))}
          </Grid>
        </div>

        {/* <div><p>Click Keyword </p></div>
        <div className={classes.stats}>

          <Grid container spacing={1}>
            {devices.map(device => (
              <Grid item xs={12} sm={3}>
                <Button variant="outlined" fullWidth='true' color="primary" onClick={() => keywordClick(device.title)} >{device.title}</Button>
              </Grid>

            ))}
          </Grid>
        </div> */}

      </CardContent>
    </Card >
  );
};

PieChart.propTypes = {
  className: PropTypes.string
};
const mapStateToProps = ({ productStore }) => ({  //2
  CurrentProduct: productStore.CurrentProduct,
  graphData: productStore.graphData,
  CurrentKeyword: productStore.CurrentKeyword,
  reviewNumber: productStore.reviewNumber,
});

const mapDispatchToProps = dispatch => {
  return {
    changeCurrentProduct: CurrentProduct => dispatch(changeCurrentProduct(CurrentProduct)),
    changeCurrentKeyword: CurrentKeyword => dispatch(changeCurrentKeyword(CurrentKeyword)),
  }
};

export default connect( // 스토어와 연결
  mapStateToProps,
  mapDispatchToProps,
)(PieChart);
